माझ्या वाढदिवसानिमित्त महाराष्ट्र राज्याचे मुख्यमंत्री मा.श्री. देवेंद्रजी फडणवीस साहेब यांनी पत्राद्वारे शुभेच्छा दिल्या. साहेब आपल्या आशीर्वादामुळे पुढील वाटचाल अधिक प्रेरणादायी ठरेल.आपल्या सदैव शुभेच्छा आणि मार्गदर्शन लाभो हीच प्रार्थना.
पुन्हा एकदा मनःपूर्वक आभार साहेब!
